private static int decodeOctets(int i,ByteBuffer bb,StringBuilder sb){
    int start = i;
    while(i < bb.limit()){
        int b = bb.get(i++) & 0xFF;
        if(b < 0x80){
            sb.append((char) b);
        }else if(b < 0xC0){
            continue;
        }else if(b < 0xE0){
            if(i + 1 >= bb.limit()){
                bb.position(start);
                return start;
            }
            int c = ((b & 0x1F) << 6) | (bb.get(i++) & 0x3F);
            sb.append((char) c);
        }else if(b < 0xF0){
            if(i + 2 >= bb.limit()){
                bb.position(start);
                return start;
            }
            int c = ((b & 0x0F) << 12) | ((bb.get(i++) & 0x3F) << 6) | (bb.get(i++) & 0x3F);
            sb.append((char) c);
        }else if(b < 0xF8){
            if(i + 3 >= bb.limit()){
                bb.position(start);
                return start;
            }
            int c = ((b & 0x07) << 18) | ((bb.get(i++) & 0x3F) << 12) | ((bb.get(i++) & 0x3F) << 6) | (bb.get(i++) & 0x3F);
            sb.append((char) c);
        }else if(b < 0xFC){
            if(i + 4 >= bb.limit()){
                bb.position(start);
                return start;
            }
            int c = ((b & 0x03) << 24) | ((bb.get(i++) & 0x3F) << 18) | ((bb.get(i++) & 0x3F) << 12) | ((bb.get(i++) & 0x3F) << 6) | (bb.get(i++) & 0x3F);
            sb.append((char) c);
        }else if(b < 0xFE){
            if(i + 5 >= bb.limit()){
                bb.position(start);
                return start;
            }
            int c = ((b & 0x01) << 30) | ((bb.get(i++) & 0x3F) << 24) | ((bb.get(i++) & 0x3F) << 18) | ((bb.get(i++) & 0x3F) << 12) | ((bb.get(i++) & 0x3F) << 6) | (bb.get(i++) & 0x3F);
            sb.append((char) c);
        }else{
            bb.position(start);
            return start;
        }
    }
    return bb.limit();
}

