static long compressTimeBucket(long timeBucket,int dayStep){
    if(dayStep == 0){
        return timeBucket;
    }
    DateTime dateTime = new DateTime(timeBucket * Const.UNIT_HOUR);
    int dayOfWeek = dateTime.getDayOfWeek();
    int dayOfMonth = dateTime.getDayOfMonth();
    int dayOfYear = dateTime.getDayOfYear();
    int monthOfYear = dateTime.getMonthOfYear();
    int year = dateTime.getYear();
    int newDayOfMonth = (dayOfMonth - 1) / dayStep * dayStep + 1;
    int newDayOfYear = (dayOfYear - 1) / dayStep * dayStep + 1;
    int newMonthOfYear = (monthOfYear - 1) / dayStep * dayStep + 1;
    int newDayOfWeek = (dayOfWeek + dayStep - 1) / dayStep * dayStep;
    return new DateTime(year, newMonthOfYear, newDayOfMonth, 0, 0).getMillis() / Const.UNIT_HOUR;
}

public static int computeUTF8Size(final CharSequence str,final int index,final int len){
    int size = 0;
    int end = index + len;
    for (int i = index; i < end; i++) {
        char ch = str.charAt(i);
        if (ch <= 0x7F) {
            size++;
        } else if (ch <= 0x7FF) {
            size += 2;
        } else if (Character.isHighSurrogate(ch) && i + 1 < end && Character.isLowSurrogate(str.charAt(i + 1))) {
            size += 4;
            i++;
        } else {
            size += 3;
        }
    }
    return size;
}

