public static int nextPrime(int desiredCapacity){
    if (desiredCapacity < 0) {
        throw new IllegalArgumentException("Desired capacity must be positive");
    }
    if (desiredCapacity < 2) {
        return 2;
    }
    int prime = desiredCapacity;
    boolean notPrime;
    do {
        notPrime = false;
        for (int i = 2, max = (int) Math.sqrt(prime); i <= max; i++) {
            if (prime % i == 0) {
                notPrime = true;
                break;
            }
        }
        if (notPrime) {
            prime++;
        }
    } while (notPrime);
    return prime;
}

