private void pop(final String descriptor){
    final char type = descriptor.charAt(0);
    switch (type){
        case 'V':
            pop();
            break;
        case 'Z':
        case 'B':
            pop(1);
            break;
        case 'C':
            pop(2);
            break;
        case 'S':
            pop(2);
            break;
        case 'I':
            pop(4);
            break;
        case 'F':
            pop(4);
            break;
        case 'J':
            pop(8);
            break;
        case 'D':
            pop(8);
            break;
        case 'L':
            pop(descriptor.substring(1, descriptor.length() - 1));
            break;
        case '[':
            pop(descriptor.substring(1));
            break;
        default:
            throw new IllegalArgumentException("Invalid descriptor: " + descriptor);
    }
}

